import Makeup4 from '../assets/images/Cosmetiquera4.jpeg';
import Makeup5 from '../assets/images/Cosmetiquera5.jpeg';

const makeupBags = [
    {
        src:Makeup1,
        type:"Esta cosmetiquera",
        size:"grande",
        impresion:"sublimado"
