        src:Makeup3,
        type:"Esta cosmetiquera",
        size:"grande",
        impresion:"sublimado"
    },
    {
        src:Makeup4,
        type:"Esta cosmetiquera",
        size:"grande",
        impresion:"sublimado"
    },
    {
        src:Makeup5,
        type:"Esta cosmetiquera",
        size:"grande",
        impresion:"sublimado"
    },
];
export default makeupBags;
